import { Alert } from 'reactstrap'

const ErrorMessage=(props)=>{
    return(
        <div className="col-12"style={{ width: '400px' }}>
       {props.message?<Alert color="danger">{props.message}</Alert> : null} 
       </div>
    )
}
export default ErrorMessage
